var Hapi = require('hapi');

var server = Hapi.createServer('localhost', process.argv[2] || 8000, {
  cors: true
});

var breaks = [{
    id: 1,
    name: 'Carcavelos',
    type: 'Left and Right',
    image: 'data:image/jpeg;base64,'
    },
  {
    id: 2,
    name: 'Guincho',
    type: 'Left and Right',
    image: 'data:image/jpeg;base64,'
    },
  {
    id: 3,
    name: 'Caparica',
    type: 'Left and Right',
    image: 'data:image/jpeg;base64,'
    },
  {
    id: 4,
    name: 'Praia Grande',
    type: 'Left and Right',
    image: 'data:image/jpeg;base64,'
    }];

server.route({
  method: 'GET',
  path: '/breaks',
  handler: function(request, reply) {
    return reply(breaks);
  }
});

server.route({
  method: 'GET',
  path: '/break/{id}',
  handler: function(request, reply) {
    if (request.params.id) {
      if (request.params.id > 0 && request.params.id <= breaks.length) {
        return reply(breaks[request.params.id - 1]);
      } else {
        return reply('Break not found.').code(404);
      }
    }
  }
});

server.start();